# Diffe-Helman key exchange
import secrets
def mod_exp(g, a, p):
    my_result = 1
    g = g % p

    while a > 0:
        # if odd, mutiply with result and do mod
        if a & 1:
            my_result = (my_result * g) % p

        # now that we are even
        a = a //2
        g = (g*g) % p
    return my_result
